!function(e){try{e=angular.module("ml.document-management.tpls")}catch(t){e=angular.module("ml.document-management.tpls",[])}e.run(["$templateCache",function(e){e.put("/ml-document-management/templates/directory-explorer.html",'<ul class="list-unstyled list-striped"><li><div style="width:0;height:0;overflow:hidden"><input type="file" name="_hidden_uploader_file" multiple=""></div><a ng-click="uploadFile($event)"><small class="fa-stack"><em class="fa fa-plus fa-stack-1x" aria-hidden="true">&nbsp;</em> <em class="fa fa-file-o fa-stack-2x" aria-hidden="true">&nbsp;</em></small> Add File</a></li><li><a ng-click="createDirectory()"><small class="fa-stack"><em class="fa fa-plus fa-stack-1x" aria-hidden="true">&nbsp;</em> <em class="fa fa-folder-o fa-stack-2x" aria-hidden="true">&nbsp;</em></small> Add Folder</a><div ng-if="$createDirectory"><input type="text" ng-model="model.newDirectoryName"> <button type="button" class="btn btn-primary" ng-click="submitDirectory()">Create</button></div></li><li class="parent-directory" ng-repeat="directory in directories"><span ng-click="closeDirectory(directory)" ng-if="directory.$open"><em class="fa fa-caret-down" aria-hidden="true">&nbsp;</em> <em class="fa fa-folder-open" aria-hidden="true">&nbsp;</em></span> <span ng-click="openDirectory(directory)" ng-if="!directory.$open"><em class="fa fa-caret-right" aria-hidden="true">&nbsp;</em> <em class="fa fa-folder" aria-hidden="true">&nbsp;</em></span> {{directory.name}}<div ng-if="directory.$open" class="col-sm-12"><directory-explorer case-uri="caseUri" sub-uri="subUri + directory.name + \'/\'" docs-meta="docsMeta"></directory-explorer></div></li><li ng-repeat="doc in dirFiles"><div class="col-sm-3"><a ng-href="/v1/documents?uri={{doc.document}}" target="_blank" download="{{doc.fileName}}"><em class="fa fa-file-o" aria-hidden="true">&nbsp;</em> {{doc.title || doc.fileName}} <span ng-if="doc.title">({{doc.fileName}})</span></a></div><div class="col-sm-3"><span title="{{doc.description}}">{{doc.description}}</span></div><div class="col-sm-1"><a ng-click="model.documentVersionsModal(doc.fileName, doc.document)">{{doc.version}}</a></div><div class="col-sm-2 margin-top-sm"><span title="{{doc.checkoutMessage}}" ng-if="doc.isCheckedout" class="label label-danger">Checked Out</span> <span ng-if="!doc.isCheckedout" class="label label-success">Checked In</span></div><div class="col-sm-3"><button ng-if="!doc.isCheckedout || doc.isCheckedout === \'false\'" class="btn btn-sm btn-primary" ng-click="model.checkoutDocument(doc.document)" ng-disabled="doc.isCheckedout === \'true\'">Checkout</button> <button ng-if="doc.checkedoutByCurrentUser && doc.checkedoutByCurrentUser !== \'false\'" class="btn btn-sm btn-success" ng-click="model.checkinDocument(doc.document)">Check-in</button> <button ng-if="doc.checkedoutByCurrentUser && doc.checkedoutByCurrentUser !== \'false\'" class="btn btn-sm btn-warning" ng-click="model.editDocumentModal(caseUri, doc, docsMeta)"><em class="fa fa-pencil" aria-hidden="true">&nbsp;</em> Edit</button> <button title="Archive Document" ng-if="!doc.isCheckedout || doc.isCheckedout === \'false\'" class="btn btn-sm btn-danger" ng-click="model.archiveDocument(doc.document)"><em class="fa fa-archive" aria-hidden="true">&nbsp;</em> Archive</button></div></li></ul>')}])}(),function(e){try{e=angular.module("ml.document-management.tpls")}catch(t){e=angular.module("ml.document-management.tpls",[])}e.run(["$templateCache",function(e){e.put("/ml-document-management/templates/dls.modal.html",'<div><div class="modal-header"><h3 class="modal-title">{{info.title}}</h3></div><div class="modal-body"><div ng-if="type === \'versions-list\'" class="table-responsive"><table class="table table-striped"><thead><tr><th>Version ID</th><th>Annotation</th><th>Action</th></tr></thead><tbody><tr ng-repeat="version in versions"><td>{{version.versionId}}</td><td>{{version.annotation}}</td><td><a ng-href="/v1/documents?uri={{version.versionUri}}" target="_blank" download="{{fileName|verionedFileName: version.versionId}}"><em class="fa fa-download" aria-hidden="true">&nbsp;</em></a></td></tr></tbody></table></div><div ng-if="type === \'edit-doc\'" class="table-responsive"><div class="form-group"><label>Title</label> <input class="form-control" type="text" ng-model="item.title"></div><div class="form-group"><label>Description</label> <input class="form-control" type="text" ng-model="item.description"></div><div class="form-group" ng-if="model.roles.length > 1"><label>Permissions</label><select ng-options="option.value as option.label for option in model.roles" ng-model="item.role"></select></div><h4>Additional Metadata</h4><div><button class="btn btn-primary" type="button" ng-click="item.metadata.unshift({})"><em class="fa fa-plus" aria-hidden="true">&nbsp;</em>Add Metadata</button></div><div class="well col-sm-12" ng-repeat="meta in item.metadata"><div class="input-group"><input type="text" class="form-control" ng-model="meta.label" placeholder="Label"> <input type="text" class="form-control" ng-model="meta.value" placeholder="Value"><div class="input-group-addon"><button class="btn btn-danger" type="button" ng-click="item.metadata.splice($index, 1)"><em class="fa fa-trash" aria-hidden="true">&nbsp;</em></button></div></div></div></div></div><div class="modal-footer"><button ng-if="type === \'edit-doc\'" class="btn btn-success" type="button" ng-click="save()">Save</button> <button class="btn btn-warning" type="button" ng-click="cancel()">Cancel</button></div></div>')}])}();